package com.firstems.erp.api.model.response.bill_payment;import com.google.gson.annotations.SerializedName;import java.io.Serializable;/** * Created by Nguyen Quoc Cuong on 9/4/2020. */public class BillPaymentDetail implements Serializable {    @SerializedName("MEXLNNTE_D")    private String mEXLNNTED;    @SerializedName("RFRNCODE")    private String rFRNCODE;    @SerializedName("RFRNDATE")    private String rFRNDATE;    @SerializedName("MNEYCRAM")    private double mNEYCRAM;    @SerializedName("KKKK0001")    private String kKKK0001;    @SerializedName("BUSNCODE")    private String index;        public BillPaymentDetail() {    }        public String getIndex() {        return index;    }        public void setIndex(String index) {        this.index = index;    }        public String getmEXLNNTED() {        return mEXLNNTED;    }        public void setmEXLNNTED(String mEXLNNTED) {        this.mEXLNNTED = mEXLNNTED;    }        public String getrFRNCODE() {        return rFRNCODE;    }        public void setrFRNCODE(String rFRNCODE) {        this.rFRNCODE = rFRNCODE;    }        public String getrFRNDATE() {        return rFRNDATE;    }        public void setrFRNDATE(String rFRNDATE) {        this.rFRNDATE = rFRNDATE;    }        public double getmNEYCRAM() {        return mNEYCRAM;    }        public void setmNEYCRAM(double mNEYCRAM) {        this.mNEYCRAM = mNEYCRAM;    }        public String getkKKK0001() {        return kKKK0001;    }        public void setkKKK0001(String kKKK0001) {        this.kKKK0001 = kKKK0001;    }}